Asa Akira, Brandy Talore, Charley Chase, Jessica Jaymes, Loni Evans.


Big Breast Nurses 5 - Reality Junkies. Nurse Asa is willing to do anything to help her patient recover from memory loss. Even if it means retracing his steps. When a patient's insurance coverage is up, Nurse Brandi is faced with the task of getting him to leave the hospital. Charley isn't really a nurse but she'll do anything to get a little action from her favorite doctor, even dress up as one. Nurse Jaymes is fed up working double shifts and has it out with her boss. The two find a way to get exactly what they want. A patient is showing some peculiar symptoms and busty Nurse Evans has a remedy that just might work.
